import 'dart:convert';
import 'dart:typed_data';
import 'dart:math';
import 'package:flutter/material.dart';

void main() {
  runApp(TicTacToeApp());
}

class TicTacToeApp extends StatelessWidget {
  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      debugShowCheckedModeBanner: false,
      home: TicTacToeGame(),
    );
  }
}

class TicTacToeGame extends StatefulWidget {
  @override
  _TicTacToeGameState createState() => _TicTacToeGameState();
}

class _TicTacToeGameState extends State<TicTacToeGame> {
  List<List<String>> board = List.generate(3, (_) => List.filled(3, ''));
  String currentPlayer = 'X';
  bool gameOver = false;
  String resultMessage = '';

  // Base64-encoded images
  final String playerImageBase64 = '';
  final String aiImageBase64 = '';

  Uint8List get playerImage => base64Decode(playerImageBase64);
  Uint8List get aiImage => base64Decode(aiImageBase64);

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(title: Text('Kolko i Krzyzyk wersja KOTKI!!')),
      body: Stack(
        children: [
          Center(
            child: Row(
              mainAxisAlignment: MainAxisAlignment.spaceEvenly,
              children: [
                _buildPlayerSection('Ty', playerImage),
                Column(
                  mainAxisAlignment: MainAxisAlignment.center,
                  children: [
                    for (int row = 0; row < 3; row++)
                      Row(
                        mainAxisAlignment: MainAxisAlignment.center,
                        children: [
                          for (int col = 0; col < 3; col++)
                            CellWidget(
                              value: board[row][col],
                              playerImage: playerImage,
                              aiImage: aiImage,
                              onTap: () {
                                if (!gameOver && board[row][col] == '' && currentPlayer == 'X') {
                                  setState(() {
                                    board[row][col] = 'X';
                                    currentPlayer = 'O';
                                  });
                                  makeAiMove();
                                }
                              },
                            ),
                        ],
                      ),
                    SizedBox(height: 20),
                    ElevatedButton(
                      onPressed: resetGame,
                      child: Text('Zresetuj gre'),
                      style: ElevatedButton.styleFrom(
                        foregroundColor: Colors.white, backgroundColor: Colors.black,
                        elevation: 5,
                        padding: EdgeInsets.symmetric(horizontal: 30, vertical: 10),
                        textStyle: TextStyle(fontSize: 18),
                      ),
                    ),
                  ],
                ),
                _buildPlayerSection('Twój Wróg', aiImage),
              ],
            ),
          ),
          if (gameOver)
            Center(
              child: Container(
                color: Colors.black.withOpacity(0.7),
                padding: EdgeInsets.all(20),
                child: Text(
                  resultMessage,
                  textAlign: TextAlign.center,
                  style: TextStyle(
                    fontSize: 32,
                    fontWeight: FontWeight.bold,
                    color: Colors.white,
                  ),
                ),
              ),
            ),
        ],
      ),
    );
  }

  Widget _buildPlayerSection(String title, Uint8List image) {
    return Column(
      mainAxisAlignment: MainAxisAlignment.center,
      children: [
        Text(
          title,
          style: TextStyle(fontSize: 24, fontWeight: FontWeight.bold),
        ),
        SizedBox(height: 20),
        Image.memory(image, width: 150, height: 150),
      ],
    );
  }

  void resetGame() {
    setState(() {
      board = List.generate(3, (_) => List.filled(3, ''));
      currentPlayer = 'X';
      gameOver = false;
      resultMessage = '';
    });
  }

  void makeAiMove() {
    Future.delayed(Duration(milliseconds: 500), () {
      if (!isGameOver()) {
        var bestMove = findBestMove();
        setState(() {
          board[bestMove[0]][bestMove[1]] = 'O';
          currentPlayer = 'X';
        });
      }

      if (checkWinner('O')) {
        setState(() {
          gameOver = true;
          resultMessage = 'No niestety przegrałeś';
        });
      } else if (checkWinner('X')) {
        setState(() {
          gameOver = true;
          resultMessage = 'Brawo wygrales!!!';
        });
      } else if (isDraw()) {
        setState(() {
          gameOver = true;
          resultMessage = 'Remis!';
        });
      }
    });
  }

  List<int> findBestMove() {
    List<List<int>> moves = [];
    for (int i = 0; i < 3; i++) {
      for (int j = 0; j < 3; j++) {
        if (board[i][j] == '') {
          if (isWinningMove(i, j, 'O')) return [i, j];
          if (isWinningMove(i, j, 'X')) moves.insert(0, [i, j]);
          else moves.add([i, j]);
        }
      }
    }

    if (moves.isNotEmpty) {
      if (Random().nextBool()) {
        return moves[Random().nextInt(moves.length)];
      } else {
        return moves.first;
      }
    }
    return [0, 0];
  }

  bool isWinningMove(int row, int col, String player) {
    board[row][col] = player;
    bool result = checkWinner(player);
    board[row][col] = '';
    return result;
  }

  bool isGameOver() {
    return checkWinner('X') || checkWinner('O') || isDraw();
  }

  bool isDraw() {
    return board.every((row) => row.every((cell) => cell != ''));
  }

  bool checkWinner(String player) {
    for (int i = 0; i < 3; i++) {
      if (board[i].every((cell) => cell == player) ||
          [0, 1, 2].every((j) => board[j][i] == player)) {
        return true;
      }
    }
    return [0, 1, 2].every((i) => board[i][i] == player) ||
        [0, 1, 2].every((i) => board[i][2 - i] == player);
  }
}

class CellWidget extends StatelessWidget {
  final String value;
  final Uint8List playerImage;
  final Uint8List aiImage;
  final VoidCallback onTap;

  const CellWidget({
    required this.value,
    required this.playerImage,
    required this.aiImage,
    required this.onTap,
  });

  @override
  Widget build(BuildContext context) {
    return GestureDetector(
      onTap: value == '' ? onTap : null,
      child: Container(
        width: 100,
        height: 100,
        margin: EdgeInsets.all(5),
        decoration: BoxDecoration(
          color: Colors.blue[100],
          border: Border.all(color: Colors.black, width: 2),
        ),
        child: Center(
          child: value == 'X'
              ? Image.memory(playerImage)
              : value == 'O'
              ? Image.memory(aiImage)
              : null,
        ),
      ),
    );
  }
}
